func Test_ToSvg(test *testing.T) {
	qr := Generator{}
	for _, data := range ToSvg_TestData {
		qr = qr.EncodeText(data.input)
		actual, _ := qr.ToSvg(data.border)
		if actual != data.expected {
			test.Errorf(
				"qr_generator.Test_ToSvg:\n\tactual svg -> %s\n is not equal to\n\texpected svg -> %s",
				actual, data.expected,
			)
		}
	}
}

